  false,\n\t\"url\": null,\n\t\"notes\": \"A revised version of the study designed
  to determine the effects of organochlorine pollutants on back-crowned night herons
  nesting in the Pacific Northwest and to determine the populations wintering localities.
  No new insight has been gained about the source of the DDT other than it is doubtful
  it is local. Twelve radio transmitters will be placed on adult black-crowned night
  herons at Ruby Lake in 1981. These birds will be searched for in the winter and
  prey samples will be taken for DDT analysis where they are located.\",\n\t\"owner_org\":
